parts:
{
  "name": "UBX-NAV-ODO",
  "class_id": "0x01",
  "message_id": "0x09",
  "message_type": "periodic_polled",
  "description": "Odometer solution. This message outputs the traveled distance since last reset (see UBX-NAV-RESETODO) together with an associated estimated accuracy and the total cumulated ground distance (can only be reset by a cold start of the receiver).",
  "payload_length": {
    "fixed": 20
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "version",
      "description": "Message version",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "data_type": {
        "array_of": "U1",
        "count": 3
      },
      "name": "reserved0",
      "reserved": true,
      "description": "Reserved"
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the section iTOW timestamps in Integration manual for details."
    },
    {
      "byte_offset": 8,
      "data_type": "U4",
      "name": "distance",
      "unit": "m",
      "description": "Ground distance since last reset"
    },
    {
      "byte_offset": 12,
      "data_type": "U4",
      "name": "totalDistance",
      "unit": "m",
      "description": "Total cumulative ground distance"
    },
    {
      "byte_offset": 16,
      "data_type": "U4",
      "name": "distanceStd",
      "unit": "m",
      "description": "Ground distance accuracy (1-sigma)"
    }
  ]
}
